import { useState } from "react"


const DiaryEditor = () => {
    const [author, setAuthor] = useState("DH");


    return (
        <div className="DiaryEditor">
            <h2>오늘의 일기</h2>
            <div>
                <input 
                    value={author}
                    onChange={(e) => {
                    setAuthor(e.target.value)
                }}/>
            </div>
            <div>
                <textarea />
            </div>
        </div>
    )

}

export default DiaryEditor
